const CardList = ({ cards, title }) => {
  return (
    <div className="card-list">
      <h2>{ title }</h2>
      {cards.map((card) => (
        <div className="card-preview" key={card._id}>
          <h2>{ card.petName }</h2>
          <p>Currently { card.status }</p>
        </div>
      ))}
    </div>
  )
}

export default CardList;
